cketPrice":"$25 - $750.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1330921,"name":"UFO","startTime":null,"eventDescription":"Nothing would be easier for British rock legends UFO than to rest on their laurels. The band could easily release the occasional best-of album to earn a few additional royalties and otherwise content themselves with looking back at their exceptionally glorious past. And it certainly wouldn't be a problem for UFO to sell out tours on the strength of their legendary name with a great hoopla and low artistic values. But idleness or indeed a musical standstill have always been out of the question for Phil Mogg, Paul Raymond, Andy Parker, and Vinnie Moore. These in equal measures experienced and ambitious musicians are interested in the present, their love of creativity and the active continuation of their celebrated band history. And now we can look forward to Seven Deadly, the band's latest studio album which combines present and future with UFO's greatest fortes. Mogg, Raymond, Parker and Moore are release twelve brand-new songs on Steamhammer/SPV in Germany on 24 February 2012 (Europe: 27 February, USA/Canada: 28 February), featuring – without going into great detail at this point – some of the strongest compositions this band has ever recorded.

